// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./Forging/BurnForging.sol";
import "./Forging/emission/TokenVestingBurnForging.sol";

contract BecomeCGN is Ownable, BurnForging {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    /********** 变量定义区 *********/
    // 比例计算分母
    uint256 public constant rateDenominator = 1000;
    // 最大锻造额度
    uint256 public cap;
    // 最小锻造量
    uint256 public minBurnForgingAmount;
    // 间隔周期时长, 单位秒
    uint256 public stageCliffUnit;
    // tokenWallet , 出币地址
    address public tokenWallet;
    // 释放周期与对应比例关系
    struct DurationRateInfo {
      uint256 duration;
      uint256 rate; // rate, per input token to amount of output token
    }
    // 分期释放信息结构
    struct TokenVestingInfo {
        address burnerToken;
        uint256 burnedAmount;
        uint256 receiveAmount;
        address[] vestingAddress;
    }
    // 记录周期映射关系
    mapping(uint256 => DurationRateInfo) public durationRateList;
    // 记录质押合约记录
    mapping(address => TokenVestingInfo) public tokenVestingList;

    /********** 初始化合约 *********/
    constructor(
        address _token, // 代币地址
        address _tokenWallet, // 代币从这个地址发送
        address payable _wallet, // 接收ETH受益人地址
        uint256 _cap, // 封顶数量, 接收时单位是ether, 初始化时转为wei
        uint256 _minBurnForgingAmount,
        uint256 _stageCliffUnit
    )
        BurnForging(_wallet, _token) {
        require(_tokenWallet != address(0), "AllowanceBurnForging: token wallet is the zero address");
        require(_cap > 0, "CappedBurnForging: cap is 0");
        require(_minBurnForgingAmount > 0, "BecomeCGN: The minimum combustion forging amount is greater than 0");

        tokenWallet = _tokenWallet;
        cap = _cap * (10**uint256(18));
        minBurnForgingAmount = _minBurnForgingAmount * (10**uint256(18));
        stageCliffUnit = _stageCliffUnit;
    }

    /********** 后台功能 *********/
    // 设置最大锻造量
    function setCap(uint256 amount) public onlyOwner {
        cap = amount;
    }
    // 设置最小锻造量
    function setMinBurnForgingAmount(uint256 amount) public onlyOwner {
        require(amount <= cap, "BecomeCGN: The minimum forging amount must be less than the cap");
        minBurnForgingAmount = amount;
    }
    // 设置周期与比例
    function setDurationRate(uint256 duration, uint256 rate) public onlyOwner {
        require(duration >= 1, "BecomeCGN: duration value invaild");
        require(rate > 0, 'BecomeCGN: rate is greater than 0');
        DurationRateInfo storage info = durationRateList[duration];
        info.duration = duration;
        info.rate = rate;
    }
    // 间隔周期时长
    function setStageCliffUnit(uint256 timeUnit) public onlyOwner {
        stageCliffUnit = timeUnit;
    }

    /********** 数据校验 *********/
    // 重写预先验证方法
    // 校验金额
    function _preValidateBurn(address burner, uint256 burnedAmount) internal override view {
        super._preValidateBurn(burner, burnedAmount);
        require(burnedTotalAmount.add(burnedAmount) <= cap, "CappedBurnForging: cap exceeded");
        require(burnedAmount >= minBurnForgingAmount, 'BecomeCGN: The minimum forging amount does not meet the requirements');
    }

    // 计算兑换数据
    function _getOutTokenAmount(uint256 burnedAmount, uint256 duration) internal override view returns (uint256) {
        DurationRateInfo memory info = durationRateList[duration];
        uint256 rate = 0;
        if (info.duration != 0) {
            rate = info.rate;
        }
        return burnedAmount.mul(rate).div(rateDenominator);
    }

    /********** 查询功能 *********/
    /**
     * @dev Checks whether the cap has been reached.
     * @return Whether the cap was reached
     */
    function capReached() public view returns (bool) {
        return burnedTotalAmount >= cap;
    }

    /**
     * @dev Checks the amount of tokens left in the allowance.
     * @return Amount of tokens left in the allowance
     */
    function remainingTokens() public view returns (uint256) {
        return Math.min(IERC20(token).balanceOf(tokenWallet), IERC20(token).allowance(tokenWallet, address(this)));
    }

    /**
     * @dev get vestingAddress list from the tokenVestingList
     */
    function getTokenVestingAddressByAccount(address account) public view returns (address[] memory) {
        TokenVestingInfo storage info = tokenVestingList[account];
        return info.vestingAddress;
    }

    /********** 用户功能 *********/
    // 执行
    function _deliverTokens(address burner, uint256 duration, uint256 burnedAmount, uint256 receiveAmount) internal override {
        address vestingToken = address(new TokenVestingBurnForging(
            burner, // 受益人地址
            block.timestamp, // 当前时间
            duration, // 释放周期
            stageCliffUnit, // 释放间隔
            burnedAmount, // 锻造数量
            receiveAmount // 返还数量
        ));
        TokenVestingInfo storage info = tokenVestingList[burner];
        if (info.burnerToken != address(0)) {
            info.burnedAmount = info.burnedAmount.add(burnedAmount);
            info.receiveAmount = info.receiveAmount.add(receiveAmount);
            info.vestingAddress.push(vestingToken);
        } else {
            tokenVestingList[burner] = TokenVestingInfo({
                burnerToken: burner,
                burnedAmount: burnedAmount,
                receiveAmount: receiveAmount,
                vestingAddress: new address[](0)
            });
            tokenVestingList[burner].vestingAddress.push(vestingToken);
        }
        // 代币转入分期释放合约地址
        IERC20(token).safeTransferFrom(tokenWallet, vestingToken, receiveAmount);
    }
}
